const getAdminNavbar = async userRole => {
  bindEventHandlers();
  let tabs = []; //   tabs.push({ label: 'Groups', id: 'groups' });

  if (userRole == 'admin') {
    // tabs.push({ label: 'Users', id: 'admin' });
    tabs.push({
      label: 'Project Configuration',
      id: 'configs'
    });
  }

  let header = '<ul class="nav nav-tabs" role="tablist">';
  let content = '<div class="tab-content">';

  for (var i = 0; i < tabs.length; i++) {
    const id = tabs[i].id;
    const label = tabs[i].label;
    const tabID = 'tab_' + id;
    const active = i === 0 ? 'active' : '';
    const headerLi = `
    <li class="nav-item">
        <a class="nav-link ${active}" data-toggle="tab" href="#${tabID}" aria-expanded="true">${label}</a>
    </li>`;
    header += headerLi;
    let tabContent = '';

    if (id == 'groups') {
      tabContent = getGroupsTab(id);
    } else if (id == 'admin') {
      tabContent = getAdminTab(id);
    } else if (id == 'servers') {
      tabContent = getServersTab(id);
    } else if (id == 'configs') {
      tabContent = getConfigsTab(id);
    }

    const contentDiv = `
    <div role="tabpanel" class="tab-pane ${active}" searchtab="true" id="${tabID}">
        ${tabContent}
      </div>`;
    content += contentDiv;
  }

  header += `</ul>`;
  content += `</div>`;
  let ret = '';
  ret += '<div role="tabpanel">';
  ret += header;
  ret += content;
  ret += '</div>';
  return ret;
};

